import scale from '../util/deviceUtil';
import { getId } from '../util/nodeUtil';
export const flowMixin = {
  data() {
    return {
      backIcon:
        'data:image/png;base64,',
      ccIcon:
        'data:image/png;base64,',
      ccIcon2:
        'data:image/png;base64,',
      approverIcon:
        'data:image/png;base64,',
      approverIcon2:
        'data:image/png;base64,',
      noticeIcon:
        'data:image/png;base64,',
      noticeIcon2:
        'data:image/png;base64,',
      writeIcon:
        'data:image/png;base64,',
      writeIcon2:
        'data:image/png;base64,',
      branchIcon:
        'data:image/png;base64,',
      branchIcon2:
        'data:image/png;base64,',
      parallelIcon:
        'data:image/png;base64,',
      instationIcon2:
        'data:image/png;base64,',
      emailIcon2:
        'data:image/png;base64,',
      smsIcon2:
        'data:image/png;base64,',
      dingIcon2:
        'data:image/png;base64,',
      divideIcon2:
        'data:image/png;base64,',
      webhookIcon2:
        'data:image/png;base64,',
      childflowIcon2:
        'data:image/png;base64,',
      writeIcon:
        'data:image/png;base64,',
      branchPlusIcon:
        'data:image/png;base64,',
      plusIcon:
        'data:image/png;base64,',
      optionIcon:
        'data:image/png;base64,',
      settingBaseIcon:
        'data:image/png;base64,',
      isActive: false,
      // 大小，可选值为 small large
      size: 'large',
      // a-drawer内容滚动
      bodyStyle: {
        height: 'calc(100vh - 114px)',
        'overflow-y': 'auto',
      },
    };
  },
  computed: {
    /**
     * 是否手机
     * @returns
     */
    isMobile: () => {
      return scale.isMobile();
    },
    /**
     * 节点头部样式
     * @returns
     */
    nameClass() {
      return (node, defaultStyle) => {
        if (node.status == -1) {
          return defaultStyle;
        }
        return { 'node-status-not': node.status == 0, 'node-status-current': node.status == 1, 'node-status-complete': node.status == 2 };
      };
    },
    /**
     * 侧边宽度
     * @returns
     */
    drawerWidth() {
      return (width) => {
        if (!width) {
          width = '40%';
        }
        return scale.isMobile() ? '100%' : width;
      };
    },
    /**
     * 审批配置审批人Radio组件样式
     * @returns
     */
    radioStyle: () => {
      return {
        display: 'block',
        height: '22px',
        lineHeight: '22px',
        'margin-bottom': '16px',
      };
    },
    /**
     * 审批配置审批人Radio组件样式
     * @returns
     */
    approvalRadioStyle: () => {
      const width = scale.isMobile() ? '45%' : '31%';
      return {
        width: width,
        lineHeight: '22px',
        marginBottom: '16px',
      };
    },
  },
  methods: {
    uuid() {
      return getId();
    },
    /**
     * 打开侧边配置
     * @param {*} name
     * @param {*} node
     * @param {*} routeNode
     */
    open(name, node, routeNode) {
      // 高亮
      this.isActive = true;
      //  打开配置
      this.$refs[name].showDrawer(node, routeNode);
    },

    /**
     * 删除节点
     * @param {*} node
     * @param {*} fun
     */
    delNode(node, fun) {
      const me = this;
      me.$store.dispatch('flow/delNode', node);
      // 回调
      if (fun) {
        fun(node);
      }
      /* this.$confirm({
        title: '删除提示!',
        content: '您确定要删除当前节点吗?',
        okText: '确认',
        cancelText: '取消',
        onOk() {
          me.$store.dispatch('flow/delNode', node);
          // 回调
          if (fun) {
            fun();
          }
        },
        onCancel() {},
      }); */
    },
    /**
     * 添加分支节点
     * @param {*} node
     */
    addBranch(node) {
      this.$store.dispatch('flow/addBranch', node);
    },
  },
};
